(289, 'theme_mods_NextInnovation_20210216', 'a:30:{i:0;b:0;s:18:\"nav_menu_locations\";a:2:{s:12:\"primary-menu\";i:2;s:11:\"footer-menu\";i:2;}s:18:\"custom_css_post_id\";i:181;s:24:\"hide_blog_3_area_setting\";b:0;s:18:\"home_title_block_3\";s:4:\"News\";s:25:\"post_limit_blog_3_setting\";s:1:\"2\";s:23:\"category_setting_blog_3\";s:1:\"1\";s:29:\"category_post_order_3_setting\";s:4:\"DESC\";s:27:\"hide_footer_content_setting\";b:0;s:19:\"hide_banner_setting\";b:0;s:24:\"hide_blog_1_area_setting\";b:0;s:21:\"hide_about_us_content\";b:0;s:24:\"hide_our_service_setting\";b:0;s:24:\"hide_blog_2_area_setting\";b:0;s:21:\"news_category_setting\";s:1:\"0\";s:19:\"hide_client_section\";b:1;s:14:\"client_1_title\";s:21:\"TDO Business Solution\";s:11:\"hide_widget\";b:0;s:24:\"home_description_block_1\";s:410:\"Next Innovations Co., Ltd is a company based in Japan, we provide high quality and innovative web design with our professional web developers to our client\'s full satisfaction. Working with world wide clients and handling over 1,000 websites in Japan. We have a well-coordinated team with streamlined processes which makes working with us a lot easier - in other words, it\'s the best UI/UX agency you can find.\";s:22:\"footer_address_setting\";s:106:\"NEXT INNOVATOINS. LTD.\nOffice Address - No(446),Thihathu Street,11 Ward,South Okkalapa Tsp,Yangon, Myanmar\";s:20:\"banner_title_setting\";s:28:\"TURN YOUR IDEAS INTO REALITY\";s:25:\"abt_content_1_description\";s:229:\"We improve a site\'s ornament value by strategically implementing elements such as fonts, colors and images. When professionally done, visual design makes a huge impact on a website without compromising on its function or content.\";s:25:\"abt_content_2_description\";s:204:\"We aim to provide positive experiences that keep a user loyal to the product or brand. In conclusion, we turn potential visitors to buyers as it facilitates interactions between the user and your website.\";s:25:\"abt_content_3_description\";s:227:\"Promoting a website doesn\'t have to cost you a ton of money. In fact, it doesn\'t have to cost you any money at all. We improve your site\'s ranking on Google and other search engines. Unlike paid search ads, SEO is totally free.\";s:25:\"abt_content_4_description\";s:240:\"We see the business idea behind the project and how it will affect our client\'s value. We optimize and propose useful features to make your business more profitable, therefore more sales. It\'s definitely a win-win situation working with us.\";s:11:\"custom_logo\";i:383;s:11:\"hide_author\";b:0;s:16:\"hide_public_date\";b:0;s:12:\"banner_image\";s:102:\"http://web-dev.88175848-86-20200805092356.webstarterz.com/sample/wp-content/uploads/2022/02/ni-bnr.png\";s:11:\"abt_bgImage\";s:133:\"http://web-dev.88175848-86-20200805092356.webstarterz.com/sample/wp-content/uploads/2022/02/group-people-working-website-template.png\";}', 'yes'),
