(46, 1, '2021-02-24 07:57:10', '2021-02-24 07:57:10', '<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->', 'Hello world!', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2021-02-24 07:57:10', '2021-02-24 07:57:10', '', 1, 'http://localhost/sample/1-revision-v1/', 0, 'revision', '', 0),
(50, 1, '2021-02-24 10:19:50', '2021-02-24 10:19:50', '<!-- wp:paragraph -->\n<p>Starting an eCommerce store, in general, is less-tricky, involves low-cost and low- risk. You are only required to have an appropriate business plan and select your products wisely. eCommerce stores will help you stay competitive. It not only furnishes a great shopping experience but will also keep your consumers updated with the latest products and services.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>eCommerce web development is the right choice for retailers who aspire to take their business to the next level or approach a broad consumer base. Obtain the best IT solutions for your online business right from conception to execution.</p>\n<!-- /wp:paragraph -->', 'The benefits of Why you need the Website for your products', '', 'publish', 'open', 'open', '', 'testing-testing', '', '', '2022-01-28 02:01:07', '2022-01-28 02:01:07', '', 0, 'http://localhost/sample/?p=50', 0, 'post', '', 0),
