(181, 1, '2021-05-24 06:24:33', '2021-05-24 06:24:33', '/* Service Table Start */\n.service-table, td{\n	border: 1px solid #1D1D20;\n}\n.service-table{\n	border-radius: 10px;\n}\n.service-table thead{\n	text-align:center;\n	height: 53px;\n  background: #1D1D20;\n  border-radius: 10px 10px 0px 0px;\n}\n.service-table th{\n	border: 1px solid #2F2F36;\n	padding: 10px 0px;\n}\n.service-table tbody{\n	background: #36363C;\n}\n.service-table td{\n	padding:10px;\n}\n\n/* Service Table End */\n\n\n.submit{\n	text-align:center;\n}\ninput.wpcf7-submit{\n	background: linear-gradient(\n92.59deg\n, #FDF148 0%, #09A2DB 100%);\n    font-family: Lato;\n    font-style: normal;\n    font-weight: bold;\n    font-size: 20px;\n    border:none;\n    text-align: center;\n    letter-spacing: 0.07em;\n    color: #F4F4F4;\n    position: relative;\n    padding: 18px 93px;\n    transition: .5s;\n    text-transform: uppercase;\n    text-decoration: none;\n}\n.contact{\n	padding:30px 0px;\n}\ninput[type=\"text\"], input[type=\"email\"]{\n	background:transparent;\n	border:1px solid #747474;\n	border-top:none;\n	border-left:none;\n	border-right:none;\n}\ntextarea{\n	background:transparent;\n	border:1px solid #747474;\n}\nselect{\n	color: #fff;\n  padding: 0px 10px;\n	height:35px;\n	background:transparent;\n	border:1px solid #747474;\n	width:100%;\n	border-radius:3px;\n}\nspan.require{\nleft: 23.36%;\nright: 74.53%;\ntop: 39.32%;\nbottom: 60.02%;\n\nfont-family: Lato;\nfont-style: normal;\nfont-weight: bold;\nfont-size: 10px;\nline-height: 12px;\n/* identical to box height */\nalign-items: center;\ntext-align: center;\nletter-spacing: 0.07em;\nbackground: #fff;\ncolor: #111;\npadding: 1px 8px;\nborder-radius: 50px;\n}\n\n/* Front Page Hocer Start */\n#ddms ul li:hover{\n	background:#fff;\n}\n/* Front Page Hover End */', 'NextInnovation_20210216', '', 'publish', 'closed', 'closed', '', 'nextinnovation_20210216', '', '', '2021-05-24 08:02:57', '2021-05-24 08:02:57', '', 0, 'http://web-dev.88175848-86